import React,{useEffect,useState} from 'react'
import Card from './Card'
import './index.css'

const App = () => {

  const [data, setdata] = useState([])

  useEffect(() => {
fetch_api()
  }, [])

  const fetch_api = async () => {
    const response =  fetch('https://api.github.com/users');
    const actual_data = (await response).json()
    setdata(actual_data)
 
  }
  

  return (
<div className='app' >
    <div className='container-fluid py-5  '>
      <div className="row g-lg-3 g-4">
        {
          data.map((curElem)=>   <Card key={curElem.id} card_data={curElem
          } />)
        }
   
     
      </div>

    </div>
    </div>
  )
}

export default App
